  `id_cuadrilla` INT NOT NULL,
  `id_atencion` INT NULL DEFAULT NULL,
  `fecha` DATETIME NULL,
  `estado` VARCHAR(4) NULL DEFAULT '',
  `motivo` TEXT NULL,
  `imagen` MEDIUMTEXT NULL,
  `lat` DOUBLE NULL DEFAULT NULL,
  `lon` DOUBLE NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `atencion_idx` (`id_atencion` ASC) VISIBLE,
